    of a larger, county/sub-county data set. As such, the map extent indicated in the
    Spatial_Domain element is representative of the larger data set and not an individual
    tile. The data sets are organized in 10,000 ft x 10,000 ft tiles using the NC Bureau
    of Land Records Management (LRMP) standards. Specific information about individual
    data tiles is included in the data delivery index. More information about this can
    be obtained at www.ncfloodmaps.com. The native EBN full return flight lines were
    converted to LAS format (version 1.1) by the North Carolina Floodplain Mapping Program
